CREATE TABLE m_tower_bonus_live_ranking_reward(
  tower_id INTEGER NOT NULL,
  ranking_type INTEGER NOT NULL,
  upper_rank INTEGER NOT NULL,
  lower_rank INTEGER,
  display_order INTEGER NOT NULL,
  ranking_result_prize_type INTEGER NOT NULL,
  content_type INTEGER NOT NULL,
  content_id INTEGER NOT NULL,
  content_amount INTEGER NOT NULL,
  PRIMARY KEY (tower_id, ranking_type, upper_rank, display_order)
);
